  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0109900 includes biological,
  chemical, discrete sample, physical and profile data collected from AURORA AUSTRALIS
  in the Indian Ocean from 2008-03-22 to 2008-04-17 and retrieved during cruise CLIVAR_SR03_2008.
  These data include ALKALINITY, CHLOROFLUOROCARBON-11 (CFC-11), CHLOROFLUOROCARBON-113
  (CFC-113), CHLOROFLUOROCARBON-12 (CFC-12), DISSOLVED INORGANIC CARBON, DISSOLVED
  ORGANIC CARBON, DISSOLVED OXYGEN, FLUORESCENCE, HYDROSTATIC PRESSURE, NITRATE, PHOSPHATE,
  PHOTOSYNTHETIC ACTIVE RADIATION (PAR), SALINITY, SILICATE, Total Dissolved Nitrogen
  (TDN) and WATER TEMPERATURE. The instruments used to collect these data include
  Alkalinity titrator, CTD, Coulometer for DIC measurement, PAR Sensor and bottle.
  These data were collected by Bronte Tilbrook and Stephen R. Rintoul of Commonwealth
  Scientific and Industrial Research Organization as part of the CLIVAR_SR03_2008
  data set.nnThe International CLIVAR Global Ocean Carbon and Repeat Hydrography Program
  carries out a systematic and global re-occupation of select WOCE/JGOFS hydrographic
  sections to quantify changes in storage and transport of heat, fresh water, carbon
  dioxide (CO2), and related parameters.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
